import React, {useState} from 'react'
import logo from '../../assets/logos/invocom-log.png';
import Header from '../../Components/Header';
import Brand from '../../Components/Brand'
import '../../assets/styles/global.scss';
import Slider from "react-slick";
var moment = require('moment');
moment().format();

const FormScreen = () => {
    var settings = {

        arrows:true,
        infinite: true,
        speed: 500,
        slidesToShow: 5,
        slidesToScroll: 1
      };
      var settingsTime = {

        arrows:true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1
      };
    // eslint-disable-next-line react-hooks/rules-of-hooks
    const[show , setShow] = useState(true);
    const [date , setDate] = useState('');
    // let hoursAndMinutes = time.split(':');

    // let updatedDate = moment(date).set("hours",hoursAndMinutes[0]).set("minutes",hoursAndMinutes[1]).set("seconds",'00').toDate();
    const days = []
      const dateStart = moment()
      const dateEnd = moment().add(7, 'days')
      while (dateEnd.diff(dateStart, 'days') >= 0) {
       days.push(dateStart._d.toString())
       dateStart.add(1, 'days')
       const renderDay = (day,id) => {

        const dayInfo = day.split(' ');
        return  <div className="calender-style" onClick={() => { setDate(day) }}>
        <p className="text-xs" key={id}>{dayInfo[1]}</p>
        <p className="text-xs">{dayInfo[2]}</p>
     </div >
      }
    return (
      <div className="complete_bot">
          { show? 
        (          <div className="widget">
      <Header/>

        <div className="message_body">
            <div className="calendar_container">
          <div className="calendar_body">
           <p><strong>Select Date & Time</strong></p>
           <p>(30 min meeting) <span> UTC +05:00 Islamabad, Karachi </span> </p>
           <p><strong>October 10, 2021</strong></p>
                <div className="slider_container">
                            <Slider className="date_slider" {...settings}>

                                <div className="date_option">
                                {days.map((day,id) =>
                              renderDay(day,id)
                           )}
                                </div>

                            </Slider>

                  </div>

                  <div className="slider_container py-4" style={{borderTop:'1px solid #1b3660', borderBottom:'1px solid #1b3660'}}>
                            <Slider className="date_slider" {...settingsTime}>

                                <div className="time_option">
                                    <h3>1</h3>
                                </div>
                                <div className="time_option">
                                    <h3>2</h3>
                                </div>
                                <div className="time_option">
                                    <h3>3</h3>
                                </div>
                                <div className="time_option">
                                    <h3>4</h3>
                                </div>
                                <div className="time_option">
                                    <h3>5</h3>
                                </div>
                                <div className="time_option">
                                    <h3>6</h3>
                                </div>
                            </Slider>

                  </div>

                  <div className="slider_container">
                      <div className="slick_btn_container">
                        <button className="cancel-btn"> Cancel</button>
                        <button className="confirm-btn">Confirm</button>
                      </div>
                  </div>
          </div> 
          </div>
        </div>
       <Brand />
        </div>)
        :
        ('')  
        }

          <img onClick={()=> setShow(!show)} src={logo} alt="" />
      </div>
    )
}
}
export default FormScreen
